function stairMean(array) {
  // Check if the array is empty to avoid division by zero.
  if (array.length === 0) {
    return 0;
  }
  const sum = array.reduce((accumulator, currentValue) => accumulator + currentValue, 0);
  const mean = sum / array.length;
  return mean;
}

function getIdInRange(data, valueLabel1, valueLabel2, low1, low2, high1, high2, tolerance, trialType) {
  let lower1, lower2, upper1, upper2, trial_conditions;

  switch (trialType) {
    case "ll":
      lower1 = low1 - tolerance;
      upper1 = low1 + tolerance;
      lower2 = low2 - tolerance;
      upper2 = low2 + tolerance;
      break;
    case "lh":
      lower1 = low1 - tolerance;
      upper1 = low1 + tolerance;
      lower2 = high2 - tolerance;
      upper2 = high2 + tolerance;
      break;
    case "hl":
      lower1 = high1 - tolerance;
      upper1 = high1 + tolerance;
      lower2 = low2 - tolerance;
      upper2 = low2 + tolerance;
      break;
    case "hh":
      lower1 = high1 - tolerance;
      upper1 = high1 + tolerance;
      lower2 = high2 - tolerance;
      upper2 = high2 + tolerance;
      break;
    default:
      return null;
  }

  trial_conditions = [
    { valueLabel: valueLabel1, lower: lower1, upper: upper1 },
    { valueLabel: valueLabel2, lower: lower2, upper: upper2 },
  ];

   
  const filteredData = data.filter(item => {
    return trial_conditions.every(condition => {
      const {valueLabel, lower, upper } = condition;
      return item[valueLabel] >= lower && item[valueLabel] <= upper;
    });
  });

  let n_images = filteredData.length;
  if (filteredData.length > 0) {
    const randomIndex = Math.floor(Math.random() * filteredData.length);
    const selectedData = filteredData[randomIndex];
    return {
      id: selectedData.id,
      values: selectedData,
      f1: lower1 + window.range_tolerance,
      f2: lower2 + window.range_tolerance,
      n: n_images
    };
  } else {
    return null;
  }
};

