this.respond = (response=null, timestamp=undefined) => {
  response === this.parameters.response; 
  this.parameters.correct = (response === trialType);
  let l1 = this.parameters.feature_level1;
  let l2 = this.parameters.feature_level2;

  if (!only_once_stim && one_response){
    let wait = this.parameters.selection_duration;

    /* Staircase processing */
    if (this.parameters.correct) {
      window.stair.f1.vals[l1][window.stair.f1[l1]] = this.parameters.f1;
      window.stair.f1[l1] += 1;
      window.stair.f2.vals[l2][window.stair.f2[l2]] = this.parameters.f2;    
      window.stair.f2[l2] += 1;    
    } else { /* error response */
      if (l1[0] === response[0]) { /* if feature 1 correct */
        window.stair.f1.vals[l1][window.stair.f1[l1]] = this.parameters.f1;
        window.stair.f1[l1] += 1;
      } else {
        window.stair.f1[l1] = 0;
        if (l1 === 'low') {
          window.conditions[0][l1] = window.conditions[0][l1] - window.stair.step;
        };
        if (l1 === 'high') {
          window.conditions[0][l1] = window.conditions[0][l1] + window.stair.step;
        };
      };

      if (l2[0] === response[1]) { /* if feature 2 correct */
        window.stair.f2.vals[l2][window.stair.f2[l2]] = this.parameters.f2;
        window.stair.f2[l2] += 1;
      } else {
        window.stair.f2[l2] = 0;
        if (l2 === 'low') {
          window.conditions[1][l2] = window.conditions[1][l2] - window.stair.step;
        };
        if (l2 === 'high') {
          window.conditions[1][l2] = window.conditions[1][l2] + window.stair.step;
        };
      };
    };

    if (window.stair.f1[l1] === window.stair.streak) {
      if (l1 === 'low') {
        if (stairMean(window.stair.f1.vals[l1]) + window.stair.step > window.value_limits.low.high){
          window.conditions[0][l1] = window.conditions[0][l1] + window.stair.step;
        } else {
        window.conditions[0][l1] = stairMean(window.stair.f1.vals[l1]) + window.stair.step;
        };
      } 
      if (l1 === 'high') {
        if (stairMean(window.stair.f1.vals[l1]) - window.stair.step < window.value_limits.high.low){
          window.conditions[0][l1] = window.conditions[0][l1] - window.stair.step;
        } else {
          window.conditions[0][l1] = stairMean(window.stair.f1.vals[l1]) - window.stair.step;
        };
      } 
      window.stair.f1[l1] = 0;
      window.stair.f1.vals[l1] = window.stair_vals;
    };

    if (window.stair.f2[l2] === window.stair.streak) {
      if (l2 === 'low') {
        if (stairMean(window.stair.f2.vals[l2]) + window.stair.step > window.value_limits.low.high) {
          window.conditions[1][l2] = window.conditions[1][l2] + window.stair.step;
        } else {
          window.conditions[1][l2] = stairMean(window.stair.f2.vals[l2]) + window.stair.step;
        };
      };
      if (l2 === 'high') {
        if (stairMean(window.stair.f2.vals[l2]) - window.stair.step < window.value_limits.high.low){
          window.conditions[1][l2] = window.conditions[1][l2] - window.stair.step;
        } else {
          window.conditions[1][l2] = stairMean(window.stair.f2.vals[l2]) - window.stair.step;
        };
      };
      window.stair.f2[l2] = 0;
      window.stair.f2.vals[l2] = window.stair_vals;
    };

    /* Limit staircase values from approaching 0*/
    // if low1 approaches 0
    if (window.conditions[0].low >= window.value_limits.low.high) {
      window.conditions[0].low = window.conditions[0].low - window.stair.step;
    };
    // if high1 approaches 0
    if (window.conditions[0].high <= window.value_limits.high.low) {
      window.conditions[0].high = window.conditions[0].high + window.stair.step;
    };
    // if low2 approaches 0
    if (window.conditions[1].low >= window.value_limits.low.high) {
      window.conditions[1].low = window.conditions[1].low - window.stair.step;
    };
    // if high2 approaches 0
    if (window.conditions[1].high <= window.value_limits.high.low) {
      window.conditions[1].high = window.conditions[1].high + window.stair.step;
    };

    /* Don't go over a limit */
    // if low1 is fading away
    if (window.conditions[0].low <= window.value_limits.low.low) {
      window.conditions[0].low = window.conditions[0].low + window.stair.step;
    };
    // if high1 is drifting off
    if (window.conditions[0].high >= window.value_limits.high.high) {
      window.conditions[0].high = window.conditions[0].high - window.stair.step;
    };
    // if low2 is fading away
