function get_stair_mean(values) {
  let n_back = window.stair.n_back;
  let lastNElements = values.slice(-n_back);
  let sum = lastNElements.reduce((accumulator, currentValue) => accumulator + currentValue, 0);
  let average = sum / n_back;
  return average;
};

